description:
Lindsey Olsen and Olivia in Woodman Casting X, 2012.02.14, RECODED


This file has been recoded since it was originally over 7 GB, which is a bit excessive for an hour. The original bitrate was 12.9 Mbit/s and the video quality didn't do much to deserve it.

It has been recoded in x264 (Level 4.1, 5 reference frames) and AC3 2.0 @ 192 kbps and put in an mkv container with chapters.


It consists of:

1. A casting interview with Lindsey Olsen (avg bitrate 6000 kbps)
2. A casting interview with Olivia (avg bitrate 4000 kbps)
3. Hardcore sex with the gals and a few guys on a bed (avg bitrate 8000 kbps)


The size is now about half of the original.

Do share it elsewhere if you find it convenient!


